var c=()=>{$.busyLoadFull("show",{background:"#5e626b",spinner:"circles",animation:"slide"}),Shiny.addCustomMessageHandler("app-ready",l=>{setTimeout(()=>{$.busyLoadFull("hide")},1e3)}),Shiny.addCustomMessageHandler("update-dashboard-zoom",l=>{$(l.id).css("zoom",l.zoom)}),Shiny.addCustomMessageHandler("select-scoutbar-page",l=>{let b;switch(l.value){case"links":b=0;break;case"serialize":b=1;break}$(".scoutbar-cell-item")[b].click()}),Shiny.addCustomMessageHandler("hide-block",l=>{$(l.offcanvas).find(".offcanvas-body").append($(l.block_id).find(".card"))}),Shiny.addCustomMessageHandler("show-block",l=>{$(l.panel_id).append($(l.block_id))})};$(function(){c()});
